import React from "react";
import { useNavigate } from "react-router";
import { Outlet } from "react-router";

export default function SubscriptionsComp(){

    const navigate = useNavigate()

    //Navigate to addMember page if the user has the permission to do it
        const addMember = () => {
            let bool = false
            for (let per of permissions)
                if (per === 'Create Subscriptions')
                    bool = true
            bool ? Navigate('/mainPage/subscriptions/addMember') : alert("You Don't Have The Permission To Add Member")
        }

    return (
        <div  style={{margin:'auto',textAlign:'center'}}>
            <h2>Subscriptions</h2>
            <button onClick={() => navigate('/mainPage/subscriptions/allMembers')}>All Members</button>
            <button onClick={addMember}>Add Member</button>
            <Outlet />
        </div>
    )
}
